import {Component} from 'react';
import{Link} from 'react-router-dom';
import {parseJwt} from '../../services/auth';

import Header from '../../Components/header/header'
import '../../App.css';

class Admin extends Component{
    constructor(props){
        super(props);
        this.state = {
            listaConsultas : [],
            medicoNome : '',
            pacienteNome : '',
            horarioConsulta : ''
        }
    }



    render(){
        return(
            <Header />
        )
    }
}

export default Admin;
